  "name": "NAO Robot Eyebrows",
  "summary": "a 3D printed headset to allow acting robots to easily express more vibrant emotions",
  "description": ["Eyebrows or facial muscle movement tend to be key indicators of what emotion is being expressed by a person or an object. When it comes to the robots, however, neither of these features are available, making it increasingly challenging to convey a wide variety of emotions with only movement and speech. Due to the inability to change any facial muscles on the robot, it was decided that attempting to add eyebrows would be the best way to begin expressing a wider breadth of emotions.", "One of the leading robots in the field of robot-human interaction is the NAO robot, so we decided to build off of <a href='https://link.springer.com/article/10.1007/s12369-016-0363-x' target='_blank' rel='noopener noreferrer'> a previously proposed model for pluggable eyebrows</a> for these robots. In this study, we analyzed if the inclusion of pluggable eyebrows on the NAO robot will assist with its ability to convey different emotional expressions.", "The project is documented <a href='https://medium.com/@heatherkemp_89938/a-journey-with-nao-robots-and-arduinos-towards-eyebrows-b4d5fef6549f' target='_blank' rel='noopener noreferrer'>here</a> while an in-depth tutorial at how to set up a similar experiment is seen <a href='https://medium.com/@heatherkemp_89938/interfacing-nao-robots-with-the-arduino-in-depth-tutorial-284ecba0b0aa' target='_blank' rel='noopener noreferrer'>here</a>."],
